import { memo, SVGProps } from 'react';
const HeloIcon = (props: SVGProps<SVGSVGElement>) => (
  <svg
    width={39}
    height={39}
    viewBox="0 0 39 39"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <rect width={39} height={39} fill="url(#pattern0_8_471)" />
    <defs>
      <pattern
        id="pattern0_8_471"
        patternContentUnits="objectBoundingBox"
        width={1}
        height={1}
      >
        <use xlinkHref="#image0_8_471" transform="scale(0.00195312)" />
      </pattern>
      <image
        id="image0_8_471"
        width={512}
        height={512}
        xlinkHref="data:image/png;base64,"
      />
    </defs>
  </svg>
);
const Memo = memo(HeloIcon);
export { Memo as HeloIcon };
